    <style>
      * {
        box-sizing: inherit;
      }
      html {
        box-sizing: border-box;
        margin: 0;
        padding: 0;
      }
      body {
        margin: 0;
        padding: 1em;
      }
      .container {
        display: flex;
      }
      .photo {
        aspect-ratio: 1;
        width: 100%;
        object-fit: cover;
      }
      .polaroid {
        padding: 1em;
        width: 12em;
        margin: 0;
        background-color: white;
        box-shadow: 0 10px 20px rgba(0,0,0,0.19), 0 6px 6px rgba(0,0,0,0.23);
        transition: ease;
        transition-duration: 1s;
        height: min-content;
        z-index: 1;
        position: relative;
      }
      .polaroid.open {
        width: min(calc(100svh - 5em), calc(100svw - 2em));
        margin: auto;
        transform: none !important;
        transition: ease;
        transition-duration: 1s;
        z-index: 2;
      }
      .polaroid .close::after {
        content: 'âœ•';
      }
      .polaroid .close {
        display: none;
        position: absolute;
        top: 1em;
        right: 1em;
        background-color: red;
        opacity: 0.7;
        color: white;
        justify-content: center;
        align-items: center;
        border-radius: 10em;
        width: 2em;
        height: 2em;
      }
      .polaroid .close:hover {
        font-weight: bold;
        opacity: 1;
      }
      .polaroid.open .close {
        display: flex;
      }
      .caption {
        font-family: 'Fasthand', cursive;
        font-size: 1.5em;
        margin: 0;
        padding: 0;
        padding-inline-start: 0.25em;
        text-align: center;
        text-overflow: ellipsis;
        overflow: hidden;
        white-space: nowrap;
        width: 100%;
      }

    <script>
      const container = document.querySelector('div.container');
      const polaroids = [];
      function addPhoto(caption, photo) {
        const div = document.createElement('div');
        div.classList.add('polaroid');
        const img = document.createElement('img');
        img.classList.add('photo');
        img.src = photo;
        img.alt = caption;
        const p = document.createElement('p');
        p.classList.add('caption');
        p.innerText = caption;
        const close = document.createElement('div');
        close.classList.add('close');
        close.addEventListener('click', toggleClose);
        div.append(img);
        div.append(p);
        div.append(close);
        const degree = Math.floor(Math.random() * 30) - 15;
        div.style.transform = `rotate(${degree}deg)`;
        div.addEventListener('click', toggleOpen);
        polaroids.push(div);
        container.append(div);
      }
      function toggleOpen(event) {
        polaroids.forEach(polaroid => polaroid.classList.remove('open'));
        this.classList.add('open');
      }
      function toggleClose(event) {
        polaroids.forEach(polaroid => polaroid.classList.remove('open'));
        event.stopPropagation();
      }
